      spb_popup_id = 'spb-' + block_id
      modal_class = block_id + '-modal'
      modal_close_class = block_id + '-modal-close'
      modal_minimize_class = block_id + '-modal-minimize'
      modal_minimized_class = block_id + '-modal-minimized'
