      $(css_identity + block_id).
        wrap($('<div class="' + modal_class + '"></div>'))
      // Hide the popup initially
      $('.' + modal_class).hide()
      // Skip the popup based on visit counts settings
      if (match == -1 && allow_cookie == true) {
        return true
      }      
